import React, {Component} from 'react';
import Header from "../header/Header";
import Sections from "../sections/Sections";
import Footer from '../footer/Footer';

export default class Home extends Component {
  render() {
      return (
        <div className="Home">
          <Header/>
          <Sections/> 
          <Footer/>
        </div>
      );
  }
}
